//    console.log(contras)
    function getNames(id) {
        if(id === "p1") {
            return "Thiago"
        }
        if(id === "p2") {
            return "Rick"
        }
        if(id === "p3") {
            return "Joao"
        }
        if(id === "p4") {
            return "Daniel"
        }
        if(id === "p5") {
            return "Vitor"
        }
    }
    const players = Object.entries(contras)
   return (
       <div>
           { players.map((element) => {
               console.log(element[1])
        return  (
                <div>
                    <div>{getNames(element[0])}</div>
                    <div>Vitorias </div>
                </div>
            )
        })}
       </div>
   )
     
}
